import {ChooseCardStyled,
  ChooseCardImageBox,
  ChooseCardHeader
} from "./ChooseCard.styled"

export const ChooseCard = ({image, header, text}) => {
    return (
  <ChooseCardStyled>
    <ChooseCardImageBox>
    <img src={image} alt={header}/>
    </ChooseCardImageBox>
    <h3>{header}</h3>
    <p>{text}</p>
  </ChooseCardStyled>
    );
}
